pub enum RelocationTarget {
    UserFunc(FuncIndex),
    LibCall(ir::LibCall),
    JumpTable(FuncIndex, ir::JumpTable),
}

pub enum CompileError {
    Wasm(WasmError),
    Codegen(String),
    DebugInfoNotSupported,
}

pub enum EntityIndex {
    Function(FuncIndex),
    Table(TableIndex),
    Memory(MemoryIndex),
    Global(GlobalIndex),
}

pub enum MemoryStyle {
    Dynamic,
    Static {
        bound: u32,
    },
}
